import React, { useState } from "react";
import PropTypes from "prop-types";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Tabs from "@material-ui/core/Tabs";
import Tab from "@material-ui/core/Tab";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";
import Styles from "./NavBar.module.css";

function TabPanel(props) {
	const { children, value, index, ...other } = props;
	const element = <div>{children}</div>;
	return (
		<div
			role="tabpanel"
			hidden={value !== index}
			id={`simple-tabpanel-${index}`}
			aria-labelledby={`simple-tab-${index}`}
			{...other}
		>
			{value === index && element}
		</div>
	);
}

TabPanel.propTypes = {
	children: PropTypes.node,
	index: PropTypes.any.isRequired,
	value: PropTypes.any.isRequired,
};

function a11yProps(index) {
	return {
		id: `simple-tab-${index}`,
		"aria-controls": `simple-tabpanel-${index}`,
	};
}

const useStyles = makeStyles((theme) => ({
	root: {
		flexGrow: 1,
		backgroundColor: theme.palette.background.paper,
	},
}));

export default function SimpleTabs() {
	const classes = useStyles();
	const [value, setValue] = useState(0);

	const handleChange = (event, newValue) => {
		setValue(newValue);
	};

	return (
		<div className={Styles.Container}>
			<div className={Styles.NavBarContainer}>
				<div className={Styles.Button}>Todas</div>
				<div className={Styles.Button}>Tendencias</div>
				<div className={Styles.Button}>Arte</div>
				<div className={Styles.Button}>Comida</div>
				<div className={Styles.Button}>Hogar</div>
				<div className={Styles.Button}>Estilo</div>
				<div className={Styles.Button}>Mas</div>
			</div>
			<div className={Styles.TabPanelContainer}></div>

			{/* <TabPanel value={value} index={0}>
				Todas
			</TabPanel>
			<TabPanel value={value} index={1}>
				Tendencias
			</TabPanel>
			<TabPanel value={value} index={2}>
				Arte
			</TabPanel>
			<TabPanel value={value} index={3}>
				Comida
			</TabPanel>
			<TabPanel value={value} index={4}>
				Hogar
			</TabPanel>
			<TabPanel value={value} index={5}>
				Estilo
			</TabPanel> */}
		</div>
	);
}
